import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Link
} from "react-router-dom";

const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <h2>Home page</h2>
    </div>
  );
}

const About = () => {
  return (
    <div>
      <h1>About</h1>
      <h2>About page</h2>
    </div>
  );
}

